import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import '../css/SignInPage.css';

import Data from './SignInPage_data';
import Model from './SignInPage_data';
import Calculate from './SignInPage_data';

class SignInPage extends React.Component {
    constructor(props) {
        super(props);

        this.username = this.props.location.state.username;
        this.password = this.props.location.state.password;

        //console.log(this.jwt_password);
        //console.log(process.env.REACT_APP_JWT_KEY);
        //console.log(typeof(this.jwt_password));
    }

    render() {
        return (
            <>
                <div className="header_box row">
                    <p className="col s4">리뷰 데이터 감성분석 시스템</p>
                    <p className="col s2">데이터 분석</p>
                    <p className="col s2">모델</p>
                    <p className="col s2">계산</p>
                    <p className="col s2">{this.username}님 환영합니다.</p>
                </div>

                <Router>
                    <Switch>
                        <Route path="/signin/data" component={Data} />
                        <Route path="/signin/model" component={Model} />
                        <Route path="/signin/calculate" component={Calculate} />
                    </Switch>
                </Router>
            </>
        )
    }
}

export default SignInPage;
